import React from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Books from './Books.js'; // Create this component
import BookDetails from './BookDetails.js'; // Create this component


function App() {
  const bookdata = {
    "title": "Medical Book Title",
    "imageUrl": "https://example.com/book-image.jpg",
    "publication": "Medical Publisher",
    "publicationDate": "2023-09-13",
    "domain": "Medicine",
    "userOverallRating": 4.5,
    "userCompletenessRating": 4.2,
    "userRelevancyRating": 4.6,
    "userClarityRating": 4.8,
    "expertOverallRating": 4.7,
    "expertCompletenessRating": 4.5,
    "expertRelevancyRating": 4.9,
    "expertClarityRating": 4.7
  }

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Books />} />
        <Route path="/book/:bookId" element={<BookDetails />} />
      </Routes>
    </Router>

  );
}

export default App;
